window.bookSummaryJSON = "<p><b>Nothing can come between us. We're stronger than ever.</b></p> <p>The longer I live at Bainbridge Hall, the more apparent it is that someone is out to get me. They know too much and are determined to use my worst fears against me. As my memories rise to the surface, they bring with them vivid reminders of what I've lived through.</p> <p>My past is tainted with awful truths, a reality that refuses to stay buried much longer.</p> <p>But one thing's for certain: these brothers I've fallen for will be here for me. They won't let me down, won't let whoever is behind the attacks on me get away with it. I'm theirs. And they are mine.</p> <p>My loyal leader. My avenging hero. And my fierce protector.</p> <p>Duke. Mason. Bear.</p> <p>Even though each of us is dealing with our own demons, we'll find a way through. Because together is the only way we'll be strong enough to take the true bastards down once and for all.</p> <p>Bainbridge Hall. Where I'll finally unlock the nightmares in my headâ€”or die trying.</p> <p>Duke <i>is the final book in the Bastards of Bainbridge Hall trilogy, centering around three men and one woman. For mature listeners. A complete list of content warnings can be found on the author's website.</i></p>"; 
